const theme = {
  colors: {
    background: '#233d4d',     // Dark Background
    text: '#FFFFFF',           // White Text
    primary: '#fe7f2d',        // Rich Gold (primary)
    secondary: '#57CC99',      // Slate Blue (secondary)
    accent: '#80ed99',         // Emerald Green (accent)
    highlight: '#c7f9cc', // Muted Teal (highlight)
  },    // Muted Teal (highlight)
};


export default theme;
